pragma solidity >=0.4.21 <0.6.0;

import "./Space.sol";
import "./tokens/MembershipToken.sol";

contract SpaceFactory {
    event NewSpace(address indexed space);

    constructor() public {
    }

    function createTokenSpace(string calldata name, address tokenAddress) external {
        Space space = new Space(name, tokenAddress);
        emit NewSpace(address(space));
    }

    function createSpace(string calldata name, address[] calldata invitees) external {
        // create new ERC721
        MembershipToken memberToken = new MembershipToken(name);
        // mint it to creator
        memberToken.inviteMembers(invitees);
        memberToken.invite(msg.sender);
        this.createTokenSpace(name, address(memberToken));
    }
}
